import Container from '../../components/Container';
import Head from 'next/head';

const About = () => {
  return (
    <Container>
      <Head>
        <title>About</title>
      </Head>
      <h1>About</h1>
      <p>
        Lorem ipsum dolor sit amet consectetur, adipisicing elit. Atque nisi sit
        incidunt ad dolore mollitia esse quidem in recusandae aperiam, id
        officiis repellat laborum odit quos, nesciunt explicabo ipsam corporis!
      </p>
    </Container>
  );
};

export default About;
